import React from 'react';
import { Component } from "react";
import { Routes, Route } from 'react-router-dom'; 


import FirstApp from '../firstapp/FirstApp';
import CounterApp from '../counter/CounterApp';
import CounterAppHook from '../counter/CounterAppHook';
import MyComponentLife from "../lifecycle/MyComponentLife";
import DemoButtons from '../testydialog/DemoButtons';
import DemoButtonsHook from '../testydialog/DemoButtonsHook';

import BookApp from '../books/BookApp';
import BookAppHook from '../bookshook/BookAppHook';

import PDatabaseApp from '../pdatabase/PDatabaseApp';
import PDatabaseAppHook from '../pdatabasehook/PDatabaseAppHook';

import NameForm from '../testydialog/NameForm';
import NameFormHook from '../testydialog/NameFormHook';
import DNameForm from '../testydialog/DNameForm';
import DNameFormHook from '../testydialog/DNameFormHook';
import TextAreaForm from '../testydialog/TextAreaForm';
import TextAreaFormHook from '../testydialog/TextAreaFormHook';
import ListForm from '../testydialog/ListForm';
import ListFormHook from '../testydialog/ListFormHook';
import RadiobuttonForm from '../testydialog/RadiobuttonForm';
import RadiobuttonFormHook from '../testydialog/RadiobuttonFormHook';
import CheckboxForm from '../testydialog/CheckboxForm';
import CheckboxFormHook from '../testydialog/CheckboxFormHook';

import ManyElemForm from '../testydialog/ManyElemForm';
import ManyElemFormHook from '../testydialog/ManyElemFormHook';

import ManyElemFormValid from '../testydialog/ManyElemFormValid';
import ManyElemFormValidHook from '../testydialog/ManyElemFormValidHook';

import  TwoWindows from "../testydialog/TwoWindows";
import  TwoWindowsHook from "../testydialog/TwoWindowsHook";

import LoginWindow from '../testydialog/LoginWindow';
import LoginWindowHook from '../testydialog/LoginWindowHook';

import  RESTDataBasePerson from "../restbase/REST_NOAUTH_DataBasePerson";

import AppStorage from "../teststorage/AppStorage";
import AppStorageHook from "../teststorage/AppStorageHook";

import  BankTransNoAuth from "../restbank/REST_NOAUTH_BankTrans";
import  BankTransNoAuthHook from "../restbank/REST_NOAUTH_BankTransHook";
import  BankTransNoAuthHookForHTML from "../restbank/REST_NOAUTH_BankTransHookForHTML";

import  BankTransBasicAuth from "../restbank/REST_BASICAUTH_BankTrans";
import  BankTransBasicAuthHook from "../restbank/REST_BASICAUTH_BankTransHook";
import  BankTransBasicAuthHookForHTML from "../restbank/REST_BASICAUTH_BankTransHookForHTML";

import  BootstrapDemo from "../bootstrapdemo/BootstrapDemo";
import  BootstrapDemoHook from "../bootstrapdemo/BootstrapDemoHook";

import  Table1 from "../testtable/Table1";
import  Table1Hook from "../testtable/Table1Hook";
import  Table2 from "../testtable/Table2";
import  Table2Hook from "../testtable/Table2Hook";
import  TestTabs from "../testtabs/TestTabs";
import  TestTabsHook from "../testtabs/TestTabsHook";

import  TestImage from "../testimage/TestImage";
import  TestImageHook from "../testimage/TestImageHook";



class MenuGlobRoutes extends Component {

    constructor(props) {
        super(props);
    }

    render() {
        return (
            <Routes>                
